    "        #adjacency_1 = adj[j]\n",
    "        program_1 = prgms[j]\n",
    "        \n",
    "        #PLAN 2\n",
    "        #adjacency_2 = adj[i]\n",
    "        program_2 = prgms[i]\n",
    "        \n",
    "        #compare PGM\n",
    "        ratio_1,ratio_2 = compare_pgm(program_1,program_2)\n",
    "        \n",
    "        ratio_1_matrix[i,j] = ratio_1\n",
    "        ratio_2_matrix[i,j] = ratio_2"
